    let randomIndex = Math.floor(Math.random() * 3);
    let finalName = names[randomIndex];
    setName(finalName);
  };
  return (
    <div>
      <h2>{props.titulo}</h2>
      <h2>{props.titulo}</h2>
      <button onClick={randomName}>Click</button>
      <h3>{name}</h3>
      <p>{props.descripcion}</p>
    </div>
  );
}

